import someObject from './config'; // Asegúrate de que este archivo existe y exporta `someObject`

console.log(someObject); // Verifica que someObject está definido

if (someObject && someObject.config) {
    const config = someObject.config;
    // Procede a usar config
} else {
    console.error('someObject o su propiedad config no está definida');
}
